import React, { Component } from 'react';
import { Form, Row,Col ,Container,Button} from 'react-bootstrap';
import BootstrapTable from 'react-bootstrap-table-next';
import filterFactory, { textFilter, dateFilter} from 'react-bootstrap-table2-filter';

import paginationFactory from 'react-bootstrap-table2-paginator';
import 'react-bootstrap-table2-filter/dist/react-bootstrap-table2-filter.min.css'
const axios = require('axios');
class removeProductProblem extends Component {


constructor(props){
  super(props);
  this.state = {
    problemName: '',
    productName: ''
  }
this.deleteProduct = this.deleteProduct.bind(this);
this.deleteProblem = this.deleteProblem.bind(this);
this.handleChange = this.handleChange.bind(this);
}
handleChange(event){
  if(event.target.name === "productName"){
    this.setState({productName: event.target.value})
  }
  else if(event.target.name === "problemName"){
    this.setState({problemName: event.target.value})
  }
}
deleteProblem(){
 
}

deleteProduct(user){
    axios.post(`http://localhost:4000/users/remove`,{
      headers: {"Content-Type": "application/json"},
      method: 'POST',
      data: {
          userName: user
      }
    })
  .then(function (response) {
    
    console.log(response.data);
  })
  .catch(function (error) {

    console.log(error);
  })
  .then(() => {
    this.assignData();
  });
  
}


  render() {
    return(
      
    
      <Container  style = {{backgroundColor: '#d3d3d3'}}>
      <Row>
      <Col  md={{ span: 6, offset: 3}}>
  <Form>
  <Col  md={{ span: 6, offset: 3}}>
    <Button  variant = "danger" > 
    Remove Product
  </Button>
    </Col>
  <Form.Group controlId="formBasicEmail">
  <Form.Label>Product Name: </Form.Label>
  <Form.Control type="text"  name= "productName" placeholder="Enter User Name" onChange = {this.handleChange}/>
  <Form.Text className="text-muted">
 
  </Form.Text>

  </Form.Group>
 
  <Form.Group controlId="formBasicPassword">
  <Form.Label>Problem Name: </Form.Label>
  <Form.Control type="text" name= "problemName" placeholder="Password"   onChange = {this.handleChange}/>
  </Form.Group>
  
  </Form>
  <Col  md={{ span: 6, offset: 3}}>
    <Button variant = "danger"  > 
    Remove Problem Type
  </Button>
    </Col>
  </Col>
  </Row>
    </Container>

    );
   
    }
    
    
  
}

export default removeProductProblem;
